import Card from './Cards'
import Sdata from './Sdata';


console.log(Sdata[0].sname);
  
 const favSeries = 'Amazon';


 const FavS = ()=>{
  if(favSeries == 'netFlix'){
    return (
      <Card 
       key = {Sdata[1].id}
       imgsrc={Sdata[1].imgsrc}
       title={Sdata[1].title} 
       sname={Sdata[1].sname}
       link={Sdata[1].link}
      />
     );
   }else{
  
   }
 }

 
 

const App = () =>{
    return(
    <>

    <h1>List og Top 5 Netflix in 2021</h1>
    <div className="flexBox">
   
   
   
     <FavS />
   
   
    </div>
    
   
   </>
    )
}

export default App;
